import { Route, Routes } from "react-router";
import { BookStore } from "../bookStore/BookStore";

export const RoutesMain = () => {
	return (
		<>
			<Routes>
				<Route path="/books" element={<BookStore />} />
				<Route path="*" element={<h3>404 Not Found</h3>} />
			</Routes>
		</>
	);
};
